head.script:
scwin.onpageload = function() {
    /* 테이블 가로세로 스크롤 연동 */
	const theadWarp = document.querySelector('.table-wrap.thead');
    const tbodyWarp = document.querySelector('.table-wrap.tbody');

    tbodyWarp.addEventListener('scroll', () => {
        theadWarp.scrollLeft =
        tbodyWarp.scrollLeft;
    })

    /* active 클래스 추가 */
    $('#mf_inq-button').click(function(){
        $('.inquiry-down')[$('.inquiry-down').hasClass('active') ? 'removeClass' : 'addClass']('active');
    })
};
